	/**
	 * AJAX - Reçoit les données image et les enregistre en base de données
	 * Renvoit un objet aeReponse avec l'ID de la nouvelle image
	 * @return aeReponse
	 */
	public function ApersistRawImageAction($entityShortName) {
		set_time_limit(300);
		$memory = $this->get('aetools.aetools')->getConfigParameters('cropper.yml', 'memory_limit');
		ini_set("memory_limit", $memory);
		$aeRawfile = $this->get('aetools.aeRawfile');
		$data = $this->getRequest()->request->get('data');

		// $data['file']['name'] = 'fichierTest_'.rand(10000,99999).'.jpg';
		// $data['file']['type'] = 'image/jpeg';
		// $data['file']['size'] = '42308';
		// $data['raw'] = 'data:image/jpeg;base64,';
		// $data['rawfiles']['list'] = array();

		$file = $this->get('aetools.debug')->debugFile($data);

		$schemaData = '#^(data:image/(png|jpg|jpeg|gif);base64,)#';
		$rotenData = preg_replace($schemaData, '', $data['raw']);
		@file_put_contents(__DIR__.'/../../../../web/params/'.$data['file']['name'], base64_decode($rotenData));

		// supprime les temporaires précédents
		$aeRawfile->deleteAllTemporaty($data['rawfiles']['list']);
		// crée un nouveau rawfile
		$rawfile = $aeRawfile->getNewRawfileWithData($data);
		$this->get('aetools.aeStatut')->setTemp($rawfile);
		return $aeRawfile->save($rawfile)->getJSONreponse();
	}




